import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

function Home() {
  return (
    <section className="home-section">
      <h1>Welcome to My Portfolio</h1>
      <p>This is the home page</p>
      <div className="resume-buttons">
        <a href="/resumes/resume1.pdf" target="_blank" rel="noopener noreferrer" className="btn">View Resume</a>
        <a href="/resumes/resume1.pdf" download className="btn">Download Resume</a>
      </div>
    </section>
  );
}

function About() {
  return (
    <section className="section">
      <h2>About Me</h2>
      <p>Iâ€™m a passionate developer working on cool projects.</p>
    </section>
  );
}

function Portfolio() {
  return (
    <section className="section">
      <h2>My Portfolio</h2>
      <p>Some of my best work goes here.</p>
    </section>
  );
}

function Gallery() {
  return (
    <section className="section">
      <h2>Gallery</h2>
      <p>All important photos, events, achievements will be shown here.</p>
    </section>
  );
}

function Contact() {
  return (
    <section className="section">
      <h2>Contact Me</h2>
      <p>You can reach out to me through my email or social platforms.</p>
    </section>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="logo">Growt<span>ech</span></div>
          <ul className="nav-links">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/portfolio">Portfolio</Link></li>
            <li><Link to="/gallery">Gallery</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/portfolio" element={<Portfolio />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>

        <footer className="footer">
          <p>&copy; 2025 Rishu Kumari. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
